import "./App.css";
import React from "react";
import { BrowserRouter, Route } from "react-router-dom";

class App extends React.PureComponent {
  render() {
    return (
      <div className="App">
        <BrowserRouter>

          <Route path="/" element="Dashboard" />
        </BrowserRouter>
      </div>
    );
  }
}

export default App;
